import ContentBox from "./components/ContentBox";
import Iframe from 'react-iframe';

// main関数
function Activities() {
    return(
        <div>
            <ContentBox>
                <h2>MUSIC</h2>
                <div>
                <Iframe class="spotifyPlayer" style="border-radius:12px" src="https://open.spotify.com/embed/playlist/7GXwfSG11hiWxRAwPMahw0?utm_source=generator&theme=0" />
                </div>
            </ContentBox>
        </div>
    );
}export default Activities;
